import React, { useState } from 'react';
import imagePath from '../constants/imagePath';
import './accordion.css'
import { useNavigate } from 'react-router-dom';

interface Accordion {
    photo?: string;
    name?: string;
    gmail?: string;
    technology?: string;
    education?: string;
    educationYear?: string;
    skills?: string;
    experience?: string;
    recentEmployee?: string;
    portfolioLink?: string;
}

interface AccordionProps {
    data?: Accordion[];
}

const Accordion = ({ data }: AccordionProps) => {
    const navigate = useNavigate();
    const [isRotated, setIsRotated] = useState(false);

    const handleClick = () => {
        setIsRotated(!isRotated);
    };
    return (
        <>
            {data && (
                <div className="accordion w-100" id="accordionExample">
                    <table className="table table-striped">
                        <thead>
                            <tr>
                                <th></th>
                                <th>Name</th>
                                <th>Email</th>
                                <th>Technology</th>
                                <th>Education Year</th>
                                <th>Action</th>
                            </tr>
                        </thead>
                        <tbody>
                            {data.map((item, index) => (
                                <React.Fragment key={index}>
                                    <tr
                                        id={`heading${index}`}
                                        className="accordion-item"
                                        data-bs-toggle="collapse"
                                        data-bs-target={`#collapse${index}`}
                                        aria-expanded="true"
                                        aria-controls={`collapse${index}`}
                                    >
                                        <td onClick={handleClick} className={isRotated ? 'rotate' : ''}><i className='bx bxs-chevron-right arrow' /></td>
                                        <td>{item.name}</td>
                                        <td>{item.gmail}</td>
                                        <td>{item.technology}</td>
                                        <td>{item.educationYear}</td>
                                        <td>
                                            <i className="fa fa-ellipsis-v"></i>
                                        </td>


                                    </tr>
                                    <tr id={`collapse${index}`} className="accordion-collapse collapse" aria-labelledby={`heading${index}`}>
                                        <td colSpan={5}>
                                            <div className="accordion-body">
                                                <div className="profile-section d-flex flex-row flex-wrap">
                                                    <div className="col-md-4 d-flex justify-content-center align-items-center border-right">
                                                        <img className="w-50 rounded-circle" src={imagePath.profilelogo} alt="Profile" />
                                                    </div>
                                                    <div className="col-md-8">
                                                        <div className='p-3'>
                                                            <div className="row mt-3">
                                                                <div className="col-md-3"><label>Date Of Joining</label></div>
                                                                <div className="col-md-9"><label>15/07/2024</label></div>
                                                            </div>
                                                            <div className="row mt-3">
                                                                <div className="col-md-3"><label>Date Of Joining</label></div>
                                                                <div className="col-md-9"><label>15/07/2024</label></div>
                                                            </div>
                                                            <div className="row mt-3">
                                                                <div className="col-md-3"><label>Contact No</label></div>
                                                                <div className="col-md-9"><label>6260335083</label></div>
                                                            </div>
                                                            <div className="row mt-3">
                                                                <div className="col-md-3"><label>Email</label></div>
                                                                <div className="col-md-9"><label>mohit@gmail.com</label></div>
                                                            </div>
                                                        </div>
                                                    </div>
                                                </div>
                                            </div>
                                        </td>
                                    </tr>
                                </React.Fragment>
                            ))}
                        </tbody>
                    </table>
                </div>
            )}
        </>
    );
};

export default Accordion;
